(function(){Application.controller("ProfileController",["$scope","$http",function(n,t){n.Manuals=[];n.User={};n.GetManuals=function(){return t({method:"POST",url:"/User/GetManualsByUserId",data:{Id:n.Id}}).success(function(t){n.Manuals=t}),t({method:"POST",url:"/User/GetUserById",data:{Id:n.Id}}).success(function(t){n.User=t})}}])}).call(this);